import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'

function Welcome(props){
    return <h1>{props.name}</h1>
}

function HiEveryone(){
    return (
        <div>
            <Welcome name="Josh"/>
            <Welcome name="Tom"/>
            <Welcome name="Susan"/>
        </div>
    );
}

ReactDOM.render(
    <HiEveryone />,
    document.getElementById('root')
);
